import "./Music.css";
import Nav from "./../Nav/Nav.js";
import "../../App.css";
import dole from "../../images/dole.jpeg";
import avant from "../../images/avant.jpg";
import dancers from "../../images/dancers.jpg";
import acousticafe from "../../images/acousticafe.jpg";
import { Slide } from 'react-slideshow-image';
import 'react-slideshow-image/dist/styles.css';

const musicImages = [
    {
        url: {dole},
        caption: "4th Fridays at the Dole"
    },
    {
        url: {dancers},
        caption: "friends dancing"
    },

]

const Music = () => {
    return (
        <div className="musicBody">
            <Nav />
            <div className="music">
                <h2>LIVE MUSIC</h2>
                <div className="music-photo-container">
                    <div class="music-photo-box">
                        <img class="music-photo" src={dole} alt=" "/>
                        <b>4th Fridays at the Dole</b>
                    </div>
                    <div class="music-photo-box">
                        <img class="music-photo" src={avant} alt=" "/>
                        <b>Avant Cycle Cafe</b>
                    </div><div class="music-photo-box">
                        <img class="music-photo" src={dancers} alt=" "/>
                        <b>4th Fridays at Starline Gallery</b>
                    </div>
                </div>
                <div className="music-box">
                    <span className="description">this page will display my music endeavors.</span>
                    <ul>
                        <li>
                            i sing & play the guitar at art shows & coffee shops
                        </li>
                        <li>
                            at notre dame, i hosted a weekly classic rock radio show through WSND-FM 88.9
                        </li>
                        <li>
                            i also like to write/record music on my own
                        </li>
                    </ul>
                </div>
            </div>
        </div>
    )
}

export default Music;
